import './App.css';
import { Route } from 'react-router-dom';

import HomePage from './pages/homepage/homepage.component';

const HatsPage=()=>{
  <div>
    <h1>Hats PAGE</h1>
  </div>
}

function App() {
  return (
    <div>
      <Route exact path='/' componenet={HomePage}/>
      <Route exact path='/hats' componenet={HatsPage}/>
    </div>
  );
}

export default App;
